$(function() {
	/* ChartJS */
	'use strict';

	var xmlHttp = new XMLHttpRequest();
	var number = [];
	var vnumber = 0;
	var cnumber = [];
	var formatClist = [];
	var snd = new Audio('data:audio/mp3;base64,');
	xmlHttp.onreadystatechange = function() {
		// console.log('xxx')
		if (xmlHttp.readyState == 4 && xmlHttp.status == 200) {
		// document.getElementById('trackData').innerHTML = xmlHttp.responseText;
		var tracklist = JSON.parse(xmlHttp.responseText);
		// console.log(tracklist)
		for (var i =0; i< tracklist.length; i++){
			var tr = document.createElement('tr');
			var url = document.createElement('td');
			var size = document.createElement('td');
			var isavailable = document.createElement('td');
			var time = document.createElement('td');
			url.innerHTML = tracklist[i].url;
			if(tracklist[i].size.length > 10){
				size.innerHTML = "new updated";	
			} else{
				size.innerHTML = tracklist[i].size;
			}
			
			isavailable.innerHTML = tracklist[i].status;
			time.innerHTML = tracklist[i].time;

			tr.appendChild(url)
			tr.appendChild(size)
			tr.appendChild(isavailable)
			tr.appendChild(time)
			document.getElementById('trackData').appendChild(tr)
		}
		
	}
		
	};
	// xmlHttp.open("POST", "https://127.0.0.1:2222/test/gettrack", true); // true for asynchronous 
	xmlHttp.open("POST", "https://176.122.147.10:2222/test/gettrack", true); // true for asynchronous 
	xmlHttp.setRequestHeader("Content-Type", "application/json;charset=UTF-8");
	xmlHttp.send(JSON.stringify({"status":"enabled"}));

	function isContained(aa, bb) {
		if(!(aa instanceof Array) || !(bb instanceof Array) || ((aa.length < bb.length))) {
			return false;
		}
		for (var i = 0; i < bb.length; i++) {
			var flag = false;
			for(var j = 0; j < aa.length; j++){
				if(aa[j] == bb[i]){
					flag = true;
                	break;
				}
			}
			if(flag == false){
				return flag;
			}
		}
			return true;
	}


	setInterval(function(){ 

		cnumber = document.getElementById('trackData').innerHTML.split('2020');
		formatClist = [];
		for (var j =0; j< cnumber.length -1 ; j++){
			if(cnumber[j].indexOf('https') !== -1){
				formatClist.push(cnumber[j].split('<tr><td>https://')[1].split('</td><td>enabl')[0]);	
			}
			
		}

		// console.log(formatClist);
		if(!isContained(number, formatClist)){
			if(vnumber%2 ==0){
				var playPromise = snd.play();
				if (playPromise !== undefined) {
    				playPromise.then(_ => {
      				// Automatic playback started!
      				// Show playing UI.
      				// snd.pause()
    				})
    				.catch(error => {
      				// Auto-play was prevented
      				// Show paused UI.
    				});
  				}	
			}
			vnumber ++;
		}
		if(vnumber > 20) {
			vnumber = 0;
			number = formatClist;
		}

		document.getElementById('trackData').innerHTML = "";

		xmlHttp.onreadystatechange = function() {
			// console.log('xxx')
			if (xmlHttp.readyState == 4 && xmlHttp.status == 200) {
			// document.getElementById('trackData').innerHTML = xmlHttp.responseText;
			var tracklist = JSON.parse(xmlHttp.responseText);
			// console.log(tracklist)
			for (var i =0; i< tracklist.length; i++){
				var tr = document.createElement('tr');
				var url = document.createElement('td');
				var size = document.createElement('td');
				var isavailable = document.createElement('td');
				var time = document.createElement('td');

				if(tracklist[i].url.indexOf("https") === -1){
					url.innerHTML = 'https://www.nike.com/cn/w?q=' + tracklist[i].url;
				} else{
					url.innerHTML = tracklist[i].url;	
				}
				
				
				if(tracklist[i].size && tracklist[i].size.length > 10){
					size.innerHTML = "new updated";	
				} else{
					size.innerHTML = tracklist[i].size;
				}
				isavailable.innerHTML = tracklist[i].status;
				time.innerHTML = tracklist[i].time;
	
				tr.appendChild(url)
				tr.appendChild(size)
				tr.appendChild(isavailable)
				tr.appendChild(time)
				document.getElementById('trackData').appendChild(tr)
				}
			}
		};
		// xmlHttp.open("POST", "https://127.0.0.1:2222/test/gettrack", true); // true for asynchronous 
		xmlHttp.open("POST", "https://176.122.147.10:2222/test/gettrack", true); // true for asynchronous 
		xmlHttp.setRequestHeader("Content-Type", "application/json;charset=UTF-8");
		xmlHttp.send(JSON.stringify({"status":"enabled"}));

	 }, 3000);

})